import React from 'react';
import { connect } from 'react-redux';

class Product extends React.Component {
  render (){
    console.log(this.props.data);
    return (
      <div style={{ padding: '30px' }}>
        hi
      </div>
    );
  };

}

export default connect(s => s)(Product);
